import React from "react";
import { useParams } from "react-router-dom";

const RestaurantPage: React.FC = ()=>{
    const { id } = useParams()
    return(
        <div className="restaurant-page">
            <h1>restaurant page ID: {id}</h1>
        </div>
    )
}

export default RestaurantPage;
